I ran across this succinct notation when I neglected curlies around the name parameter in a component function def: export default function ProductCategoryRow(name) { // This is wrong! ... {name}
} Although Webpack happily compiled it, a runtime error appeared on the console: Uncaught Error: Objects are not valid as a React child
(found: object with keys {name}). If you meant to render
a collection of children, use an array instead I called it from another component thusly: <ProductCategoryRow name="Fruits" /> What happened? The name="Fruits" syntax passed a {name: "Fruits"} prop object. So without curlies around the function def, name was assigned {name: "Fruits"}, not "Fruits" as I intended. Subsequently, {name} in the function body returned an object, not a string. Indeed, it returned an "object with keys {name}", exactly as the error indicated. So {name} in the function body returns {name: "Fruits"}--an object, not a string. One could dereference it, as {name['name']}, which is valid but odd. Or use a props param, and say {props['name']}--decidedly more readable, but still wordy. OR... since ES6 syntax supports destructuring (and unpacking) inline in the parameter list, by means of the {} syntax in that context , I could inline-destructure in the function params using {name}, which is 'way more elegant, assuming I speak ES6 destructuring. Now the {name} reference in the function body evaluates to a string--the value of the name key in props--rather than the props object itself. These two links help with understanding inline destructuring (and unpacking) of function parameters: https://bobbyhadz.com/blog/react-objects-are-not-valid-as-react-child https://stackoverflow.com/questions/58574905/destructured-object-as-function-parameter

